function logoCheck(itemsCount) {
 var windowWidth = $(window).innerWidth();
 if (itemsCount > 4 && window.matchMedia("(min-width: 1000px)").matches) {
  return true
 } else if (itemsCount > 1 && window.matchMedia("(max-width: 500px)").matches) {
  return true
 } else if (itemsCount > 2 && window.matchMedia("(max-width: 1000px)").matches) {
  return true
 } else {
  return false
 }
}

function animateLogos(wrapper) {
 var firstItem = wrapper.find(".logo-item").first();
 var items = wrapper.find(".logo-item");
 var itemsLength = items.length;
 items.each(function(key) {
  $(this).animate({
   left: -firstItem.outerWidth()
  }, 0, function() {
   if (key == itemsLength - 1) {
    wrapper.find(".columns-container").append(firstItem.clone());
    firstItem.remove();
    wrapper.find(".logo-item").css({
     left: 0
    })
   }
  })
 })
}

function stickyNav(stickMe, placeholder) {
 placeholder.css({
  height: stickMe.outerHeight(),
  width: stickMe.outerWidth()
 });

 function isTopScreen(obj) {
  var element = obj.get(0);
  var bounds = element.getBoundingClientRect();
  return bounds.top <= 0
 }

 function apply() {
  stickMe.addClass("sticky");
  placeholder.addClass("sticky")
 }

 function remove() {
  stickMe.removeClass("sticky");
  placeholder.removeClass("sticky")
 }

 function checkObj() {
  if (stickMe.hasClass("sticky")) {
   if (isTopScreen(placeholder)) {
    apply()
   } else {
    remove()
   }
  } else {
   if (isTopScreen(stickMe)) {
    apply()
   } else {
    remove()
   }
  }
 }

 function checkWidth() {
  stickMe.after(placeholder);
  if (window.matchMedia("(min-width: 950px)").matches) {
   checkObj()
  } else {
   stickMe.removeClass("sticky");
   placeholder.removeClass("sticky");
   $(".nav-overlay").after(stickMe);
   $(".nav-overlay").after(placeholder)
  }
 }
 checkWidth();
 $(window).resize(function() {
  checkWidth()
 });
 $(window).scroll(function() {
  checkWidth()
 })
}
if ($(".layout-navigation-bar").length > 0) {
 stickyNav($(".layout-navigation-bar"), $(".navigation-placeholder"))
}

